pragma solidity ^0.5.0;
pragma experimental ABIEncoderV2;

import "openzeppelin-solidity/contracts/math/SafeMath.sol";
import "openzeppelin-solidity/contracts/token/ERC20/ERC20.sol";
import "./Uniqys.sol";

/**
 * @title Withdrawable
 * @dev ERC20 withdraw logic
 */
contract Withdrawable is ERC20 {
    using SafeMath for uint256;
    using BytesLib for bytes;

    bytes WITHDRAW_KEY = bytes("Withdraw:");
    mapping (bytes32 => bool) public usedTx;
    bytes32 public genesisHash;
    Uniqys.ValidatorSet public validatorSet;

    event Withdraw(address indexed account, uint256 value);

    constructor (bytes32 _genesisHash) public {
        genesisHash = _genesisHash;
    }

    /**
     * @dev Function to withdraw tokens
     * @param _transaction The amount of tokens to withdraw.
     * @return A boolean that indicates if the operation was successful.
     */
    function withdraw(
        bytes memory _transaction,
        bytes32[] memory _transactionProof,
        Uniqys.BlockHeader memory _header,
        uint32 _consensusRound,
        bytes[] memory _signatures
    )
        public
        returns (bool)
    {
        bytes32 _txHash = keccak256(_transaction);
        uint _value = _parseWithdrawTransaction(_transaction);
        require(_value > 0, "Invalid transaction");

        Uniqys.verifyBlockHeader(validatorSet, _header, _consensusRound, genesisHash, _signatures);
        Uniqys.verifyTransaction(_transactionProof, _header.appStateHash, keccak256(_transaction));

        _mint(msg.sender, _value);
        usedTx[_txHash] = true;
        emit Withdraw(msg.sender, _value);
        return true;
    }

    function _parseWithdrawTransaction(bytes memory _transaction) private returns (uint256 value) {
        Uniqys.Transaction memory _parsed = Uniqys.parseTransaction(_transaction);
        require(_parsed.signer == msg.sender, "Signer and sender mismatch");
        require(WITHDRAW_KEY.equal(_parsed.body.slice(0, WITHDRAW_KEY.length)), "Invalid transaction");
        value = _stringToUint(_parsed.body.slice(WITHDRAW_KEY.length, _parsed.body.length - WITHDRAW_KEY.length));
    }

    function _stringToUint(bytes memory _b) private returns (uint256 result) {
        result = 0;
        for (uint i = 0; i < _b.length; i++) {
            uint256 _c = _b.toUint32(i);
            require(_c >= 48 && _c <= 57, "Invalid value");
            result = result.mul(10).add(_c.sub(48));
        }
    }
}

